import React from 'react';
import './App.css';

function HotelList({ hotels }) {
  return (
    <div className="hotel-list">
      {hotels.map(hotel => (
        <div key={hotel.id} className="hotel-card">
          <h3>{hotel.name}</h3>
          <p>üìç {hotel.city}</p>
        </div>
      ))}
    </div>
  );
}

export default HotelList;
